import React from 'react'
//import "./Hero.css";

const Hero = (props) => {
  return (
    <>
    <div className = {props.cName}>
      <img alt="Heroimage" src={props.heroimage}/>
    </div>

    <div className="hero-text">
      <h1> {props.title} </h1>
      <p> {props.text} </p>
      <a href={props.url} className={props.btnClass}>
        {props.buttonText}
      </a>
    </div>
    </>
    )
}

export default Hero
